import React from 'react';
import "../css/test.css"



const Checkbox = () =>{




    return(

        <div  className='checkbox_div'>

            <input type="checkbox" value='Yes' id='yes' name='yes'/>
            <label htmlFor="yes">Yes</label>
            <input type="checkbox" value='No' id='no' name='no'/>
            <label htmlFor="no">No</label>
            <input type="checkbox" value='Sometimes' id='sometimes'name='sometimes'/>
            <label htmlFor="sometimes">Sometimes</label>
            <button className='btn btn-success' type='button'>Next</button>
        </div>


    );

}

export default Checkbox;
